import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/footer';
import Home from './components/Home';
import Login from './auth/Login';
import Register from './auth/Register';
import PrivateRoute from './auth/PrivateRoute';
import PatientDashboard from './pages/PatientDashboard';
import MedecinDashboard from './pages/MedecinDashboard';

// ‚úÖ DASHBOARD ADMIN COMPLET - S'AFFICHE DIRECT
const AdminDashboard = () => (
  <div style={{ 
    minHeight: '100vh', 
    background: 'linear-gradient(135deg, #fef5e7 0%, #fed7aa 50%, #fdba74 100%)',
    padding: '20px 20px 80px 20px',
    fontFamily: 'system-ui, sans-serif'
  }}>
    <div style={{ maxWidth: '1400px', margin: '0 auto' }}>

      {/* HEADER */}
      <div style={{
        background: 'rgba(255,255,255,0.95)',
        backdropFilter: 'blur(20px)',
        borderRadius: '24px',
        padding: '30px',
        marginBottom: '30px',
        boxShadow: '0 25px 50px rgba(0,0,0,0.1)',
        border: '4px solid #fed7aa'
      }}>
        <div style={{ display: 'flex', flexDirection: 'column', gap: '20px' }}>
          <h1 style={{
            fontSize: '48px',
            fontWeight: '900',
            background: 'linear-gradient(135deg, #1f2937 0%, #dc2626 100%)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            margin: 0
          }}>
            üëë TABLEAU DE BORD ADMINISTRATEUR - GOVAIMED
          </h1>
          <div style={{
            display: 'flex',
            gap: '20px',
            flexWrap: 'wrap',
            fontSize: '20px',
            color: '#4b5563',
            background: 'rgba(254, 215, 170, 0.5)',
            padding: '20px',
            borderRadius: '16px'
          }}>
            <span>üë§ Super Admin</span>
            <span>üìß admin@govaimed.com</span>
            <span>üéñÔ∏è Super Admin</span>
            <span>üìÖ Cr√©√©: 15/01/2025</span>
            <span>üïê Derni√®re: 08/02/2026 11:10</span>
            <span style={{ padding: '8px 16px', background: '#d1fae5', color: '#065f46', borderRadius: '12px', fontWeight: '700' }}>‚úÖ Actif</span>
          </div>
          <div style={{ textAlign: 'right', width: '100%' }}>
            <div style={{ fontSize: '36px', fontWeight: '900', color: '#059669' }}>
              4 567 890 FCFA
            </div>
            <div style={{ fontSize: '18px', color: '#6b7280' }}>Revenus f√©vrier 2026</div>
          </div>
        </div>
      </div>

      {/* NAVIGATION */}
      <div style={{
        background: 'rgba(255,255,255,0.95)',
        backdropFilter: 'blur(20px)',
        borderRadius: '24px',
        padding: '25px',
        marginBottom: '30px',
        display: 'grid',
        gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
        gap: '20px',
        boxShadow: '0 20px 40px rgba(0,0,0,0.1)'
      }}>
        <div style={tabStyle(true)}>üìä Dashboard</div>
        <div style={tabStyle(false)}>üë• Utilisateurs (1.2K)</div>
        <div style={tabStyle(false)}>ü©∫ Validation Pros</div>
        <div style={tabStyle(false)}>‚öôÔ∏è Param√®tres</div>
      </div>

      {/* STATS */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))',
        gap: '24px',
        marginBottom: '40px'
      }}>
        <StatBox title="üë• Total Utilisateurs" value="1 247" color="#f97316" />
        <StatBox title="ü©∫ M√©decins" value="89" color="#10b981" />
        <StatBox title="üßë‚Äçüéì Patients" value="1 056" color="#3b82f6" />
        <StatBox title="üíä Pharmaciens" value="67" color="#8b5cf6" />
        <StatBox title="üìÖ RDV Aujourd'hui" value="23" color="#6366f1" />
        <StatBox title="üë• Mod√©rateurs" value="12" color="#f59e0b" />
      </div>

      {/* TABLEAU */}
      <div style={{
        background: 'rgba(255,255,255,0.95)',
        borderRadius: '24px',
        boxShadow: '0 25px 50px rgba(0,0,0,0.1)',
        border: '4px solid #dbeafe',
        padding: '30px',
        overflowX: 'auto'
      }}>
        <div style={{ 
          display: 'flex', 
          justifyContent: 'space-between',
          alignItems: 'center',
          marginBottom: '30px',
          flexDirection: 'column',
          gap: '20px'
        }}>
          <div>
            <h2 style={{ fontSize: '40px', fontWeight: '900', color: '#1f2937', margin: 0 }}>
              üë• Gestion Utilisateurs
            </h2>
            <p style={{ fontSize: '24px', color: '#6b7280', margin: '5px 0 0 0' }}>
              1 247 utilisateurs enregistr√©s
            </p>
          </div>
          <button style={{
            padding: '20px 40px',
            background: 'linear-gradient(135deg, #10b981, #059669)',
            color: 'white',
            fontSize: '24px',
            fontWeight: '900',
            borderRadius: '24px',
            border: 'none',
            boxShadow: '0 10px 25px rgba(16, 185, 129, 0.4)',
            cursor: 'pointer'
          }}>
            ‚ûï Nouvel Utilisateur
          </button>
        </div>

        <table style={{ width: '100%', borderCollapse: 'collapse', fontSize: '16px' }}>
          <thead>
            <tr style={{ background: 'linear-gradient(135deg, #f9fafb, #e5e7eb)' }}>
              {['Nom Complet', 'Email', 'R√¥le', 'Statut', 'Inscription', 'Activit√©', 'Actions'].map((th) => (
                <th key={th} style={{
                  padding: '20px',
                  fontSize: '20px',
                  fontWeight: '900',
                  color: '#1f2937',
                  textAlign: 'left',
                  borderBottom: '4px solid #d1d5db'
                }}>{th}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {[
              { name: 'Diop Aminata', email: 'aminata.diop@govaimed.com', role: 'Patient', status: 'actif', date: '15/01/2026', time: '11:10' },
              { name: 'Ndiaye Mamadou', email: 'mamadou.ndiaye@clinique.sn', role: 'M√©decin', status: 'actif', date: '10/01/2026', time: '11:00' },
              { name: 'Sow Fatou', email: 'fatou.sow@pharma.sn', role: 'Pharmacien', status: 'en attente', date: '01/02/2026', time: '16:30' }
            ].map((user, i) => (
              <UserRow key={i} {...user} />
            ))}
          </tbody>
        </table>
      </div>
    </div>
  </div>
);

// Fonctions utilitaires INLINE
const tabStyle = (active) => ({
  padding: '20px 30px',
  fontSize: '20px',
  fontWeight: '900',
  borderRadius: '20px',
  cursor: 'pointer',
  background: active ? 'linear-gradient(135deg, #f97316, #dc2626)' : '#f3f4f6',
  color: active ? 'white' : '#374151',
  boxShadow: active ? '0 10px 25px rgba(249, 115, 22, 0.4)' : 'none',
  textAlign: 'center',
  transition: 'all 0.3s ease'
});

const StatBox = ({ title, value, color }) => (
  <div style={{
    padding: '30px',
    background: `linear-gradient(135deg, ${color}20, ${color}30)`,
    borderRadius: '24px',
    border: `4px solid ${color}40`,
    cursor: 'pointer',
    boxShadow: '0 10px 25px rgba(0,0,0,0.1)'
  }}>
    <h3 style={{ fontSize: '18px', fontWeight: '700', color, margin: '0 0 15px 0', display: 'flex', alignItems: 'center', gap: '10px' }}>
      {title}
    </h3>
    <p style={{ fontSize: '48px', fontWeight: '900', color: '#1f2937', margin: 0 }}>{value}</p>
  </div>
);

const UserRow = ({ name, email, role, status, date, time }) => (
  <tr style={{ background: '#ffffff', borderBottom: '4px solid #f3f4f6' }}>
    <td style={{ padding: '20px', fontSize: '24px', fontWeight: '700', color: '#1f2937' }}>{name}</td>
    <td style={{ padding: '20px', fontSize: '18px', color: '#6b7280' }}>{email}</td>
    <td style={{ padding: '20px' }}>
      <span style={{
        padding: '12px 24px',
        background: role === 'M√©decin' ? '#d1fae5' : role === 'Pharmacien' ? '#e9d5ff' : '#dbeafe',
        color: role === 'M√©decin' ? '#065f46' : role === 'Pharmacien' ? '#581c87' : '#1e40af',
        fontWeight: '700',
        borderRadius: '20px'
      }}>{role}</span>
    </td>
    <td style={{ padding: '20px' }}>
      <span style={{
        padding: '16px 32px',
        background: status === 'actif' ? '#d1fae5' : '#fef3c7',
        color: status === 'actif' ? '#065f46' : '#92400e',
        fontWeight: '700',
        borderRadius: '24px',
        boxShadow: '0 4px 12px rgba(0,0,0,0.1)'
      }}>
        {status === 'actif' ? '‚úÖ Actif' : '‚è≥ En attente'}
      </span>
    </td>
    <td style={{ padding: '20px', fontSize: '18px', color: '#6b7280' }}>{date}</td>
    <td style={{ padding: '20px', fontSize: '18px', color: '#6b7280' }}>{time}</td>
    <td style={{ padding: '20px', display: 'flex', gap: '12px' }}>
      {['#3b82f6', '#eab308', '#f97316', '#ef4444'].map((color, i) => (
        <button key={i} style={{
          width: '56px', height: '56px',
          background: color, color: 'white',
          border: 'none', borderRadius: '16px',
          fontSize: '20px', fontWeight: '900',
          cursor: 'pointer', boxShadow: '0 6px 20px rgba(0,0,0,0.2)'
        }} />
      ))}
    </td>
  </tr>
);

function App() {
  return (
    <div className="min-h-screen flex flex-col">
      <Navbar />
      <main className="flex-grow">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* ‚úÖ TOUS LES DASHBOARDS */}
          <Route path="/patient/*" element={
            <PrivateRoute allowedRoles={['Patient']}>
              <PatientDashboard />
            </PrivateRoute>
          } />

          {/* ‚úÖ ADMIN - S'AFFICHE SUR /admin ET /admin/* */}
          <Route path="/admin/*" element={
            <PrivateRoute allowedRoles={['Admin', 'SuperAdmin', 'Super Admin']}>
              <AdminDashboard />
            </PrivateRoute>
          } />

          <Route path="/medecin/*" element={
            <PrivateRoute allowedRoles={['Medecin']}>
              <MedecinDashboard />
            </PrivateRoute>
          } />

          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </main>
      <Footer />
    </div>
  );
}

export default App;
